import { Route, Routes, Router, Navigate } from "react-router-dom";
import Comments from "../components/comments/Comments";
import AllQuotes from "./pages/AllQuotes";
import NewQuote from "./pages/newQuote";
import QuoteDetails from "./pages/QuoteDetails";
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/allquote"></Navigate>}></Route>
        <Route path="/allquotes" element={<AllQuotes />}></Route>
        <Route path="/newquote" element={<NewQuote />}></Route>
        <Route path="/allquotes/:quoteid" element={<QuoteDetails />}>
          <Route path="/comment" element={<Comments></Comments>}></Route>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
